import React, { useState, useEffect } from "react";
import Header from "../components/Header";

import image1 from "../assets/images/title1.jpeg";
import image2 from "../assets/images/title2.jpeg";
import image3 from "../assets/images/title3.jpeg";

const HomePage = () => {
	return (
        <>
            <div className="column1">
                <Header />
            </div>
            <div className="column2">
                <div className="header-images">
                    <img src={image1} alt="Child Learning Image One" />
                    <img src="nrghacks-hackathon/hackproject/frontend/src/assets/images/child-learning-1.jpeg" alt="Child Learning Image Two" />
                    <img src="nrghacks-hackathon/hackproject/frontend/src/assets/images/child-learning-1.jpeg" alt="Child Learning Image Three" />
                </div>
            </div>
        </>
	);
};

export default HomePage;
